CREATE TABLE `lot_list` (
  `IdLot` int(11) NOT NULL AUTO_INCREMENT,
  `Key` varchar(50) NOT NULL COMMENT 'Ключ лота',
  `IdAuction` int(11) NOT NULL COMMENT 'Идентификатор аукциона',
  `SaleDate` datetime DEFAULT NULL,
  `VIN` varchar(255) DEFAULT NULL,
  `DataFolder` varchar(255) DEFAULT NULL,
  `BaseURL` text COMMENT 'Базовый URL лота',
  `ManufactYear` int(11) DEFAULT NULL COMMENT 'Год выпуска',
  `Maker` tinytext COMMENT 'Марка',
  `Model` text COMMENT 'Модель',
  `Archive` tinyint(1) NOT NULL DEFAULT '0' COMMENT 'Метка, что лот является архивным',
  `CreatedDate` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`IdLot`),
  UNIQUE KEY `lotFullKey_idx` (`Key`,`IdAuction`),
  KEY `IdAuction_idx` (`IdAuction`),
  KEY `lotKey_idx` (`Key`),
  KEY `lotVIN_idx` (`VIN`),
  KEY `auctionLotlist_idx` (`IdAuction`),
  CONSTRAINT `IdAuction_lotList` FOREIGN KEY (`IdAuction`) REFERENCES `auctiones` (`IdAuction`) ON DELETE CASCADE ON UPDATE NO ACTION
